import{_ as a,c as t,o,ae as r}from"./chunks/framework.Dh1jimFm.js";const h=JSON.parse('{"title":"2017已来，回顾2016","description":"","frontmatter":{"title":"2017已来，回顾2016","date":"2017-01-17T21:59:25.000Z","tags":null},"headers":[],"relativePath":"others/2017已来，回顾2016.md","filePath":"others/2017已来，回顾2016.md"}'),s={name:"others/2017已来，回顾2016.md"};function _(c,e,d,n,l,i){return o(),t("div",null,e[0]||(e[0]=[r('<h4 id="我的2016-终于过去。" tabindex="-1">我的2016，终于过去。 <a class="header-anchor" href="#我的2016-终于过去。" aria-label="Permalink to &quot;我的2016，终于过去。&quot;">​</a></h4><p>回想这一年的时间，大半年都在待业中，从三月份金宝通辞职，七月培训，九月找工作，十月生病，十一月搬家，一年的春夏秋冬。已经循环到了起点。 大人们总是说本命年多灾多难，其实生活也是有喜有悲，但是总得来说，一些小坎坷始终都有，但是却收获了最重要的东西：工作和爱情。 能被人爱是一件很幸福的事情，但是恋爱却没有想像中那么甜蜜，可能我们还是没有磨合的彻底敞开心扉，但是我觉得已经知足了，我会在工作和陪伴之间找一个平衡点，最重要的是不能丢失自己。 来聊聊收货吧</p><h4 id="工作" tabindex="-1">工作 <a class="header-anchor" href="#工作" aria-label="Permalink to &quot;工作&quot;">​</a></h4><p>如果说在工厂的日子是为了寻找目标而蛰伏的话。那么我觉得通过这一年多的不算努力的学习和自学，花了比别人多了一半的时间，加入了前端大军，总算是把自己的目标往前走了一步吧，我不知道今后的职业生涯会是怎么样。但是我迈了第一步，总会越爬越高。 前端是个很杂的职业，先是最基本的<code>html</code>,css<code>,javascript</code>,接着各种前端框架铺面而来，vue react angular 还有node 端，现在想想来，当初学的只是马拉松只跑了一百米，前面还有很多的东西等着我，关于我的职业，我一直的想法是想变得优秀，再变伟大，可是现在连优秀都差很远，别人在用各种框架造着轮子，而我却还在用原始的方法一遍又一遍的写着<code>jquery</code>，我太想挤到行业的前面去，可是能力差的太远。现在初步的工作规划是一周写一篇文章，看看能不能坚持下去，然后翻译国外大神的作品。最重要的是多练，多写。找到自己的方向。</p><p>[烂尾了。囧😳]</p>',5)]))}const u=a(s,[["render",_]]);export{h as __pageData,u as default};
